import http from "../http-common";

class UserDataService {
  getImage(id) {
    return http.get(`/img/${id}.png`);
  }
  getAns(id) {
    return http.get(`/ans/${id}`);
  }
  endUser(name,id,phone) {
    var myUser = {"name" : name, "id": id,"phone":phone};
    return http.post(`/end_user/${myUser}`);
  }
}

export default new UserDataService();
